import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Title from "./Title";
import App from "./App";
import LargeButton from "./LargeButton";
import * as serviceWorker from './serviceWorker';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'

//prvi parametar - sta hoces da renderujes, iliti da stavis na stranicu,
//drugi parametar - gdje tacno to ide, tj u koji containter
//ReactDOM.render(<App />, document.getElementById('root'));
const routing = (
    <Router>
        <div>
            <Route exact path="/" component = {Title}></Route>
            <Route path="/test" component={LargeButton}></Route>
        </div>
    </Router>
);
ReactDOM.render(routing, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
